    def verifyData(self,data):
        if not checkEmptyFields(data):
                self.showWarningMessage("All Fields are mandatory!!")
        else:
                if checkLicenseNumber(self.medIdEntry.toPlainText().strip(),self.tableMedsDet):
                    if  (checkNumericWith0(self.medQtyAvailEntry.toPlainText().strip()) and checkNumericalData(self.medCostEntry.toPlainText().strip()) and checkNumericalData(self.medIdEntry.toPlainText().strip()))==False:
                                self.showWarningMessage("One or more numerical field values wrong!!")
                    else:
                                return True
                else:
                        self.showWarningMessage("med id number already in use!!")
        return False
    
    def addData(self):
        data = (self.medIdEntry.toPlainText().strip(),self.medNameEntry.toPlainText().strip(),
                 self.medStatusEntry.toPlainText().strip(),self.medQtyAvailEntry.toPlainText().strip(),
                 self.medCostEntry.toPlainText().strip())
        if self.verifyData(data):
             self.med_add_updt_del_thread = AddUpdateDelMedDataThread(data,flag=1)
             self.med_add_updt_del_thread.start()
             self.med_add_updt_del_thread.operationComplete.connect(self.refreshTable)
        else:
             self.showWarningMessage("Operation failed!!")

    def verifyUpdtData(self,data):
        if not checkEmptyFields(data):
                self.showWarningMessage("All Fields are mandatory!!")
        else:
                if not checkLicenseNumber(self.medIdEntry.toPlainText().strip(),self.tableMedsDet):
                    row = getSelectedRowData(self.tableMedsDet)
                    if row is not None:
                        if str(data[0]) == str(row[0]):
                                print(str(row[0])==str(data[0]))
                                if  (checkNumericWith0(self.medQtyAvailEntry.toPlainText().strip()) and checkNumericalData(self.medCostEntry.toPlainText().strip()) and checkNumericalData(self.medIdEntry.toPlainText().strip()))==False:
                                                self.showWarningMessage("One or more numerical field values wrong!!")
                                else:
                                        return True
                    else:
                        self.showWarningMessage("No row selected!!")  
                else:
                        self.showWarningMessage("med id number already in use or invalid!!")

    def updtData(self):
        data = (self.medIdEntry.toPlainText().strip(),self.medNameEntry.toPlainText().strip(),
                 self.medStatusEntry.toPlainText().strip(),self.medQtyAvailEntry.toPlainText().strip(),
                 self.medCostEntry.toPlainText().strip())
        if self.verifyUpdtData(data):
                data = (self.medIdEntry.toPlainText().strip(),self.medNameEntry.toPlainText().strip(),
                self.medStatusEntry.toPlainText().strip(),self.medQtyAvailEntry.toPlainText().strip(),
                self.medCostEntry.toPlainText().strip(),self.medIdEntry.toPlainText().strip())
                self.med_add_updt_del_thread = AddUpdateDelMedDataThread(data,flag=2)
                self.med_add_updt_del_thread.start()
                self.med_add_updt_del_thread.operationComplete.connect(self.refreshTable)
        else:
                self.showWarningMessage("Operation failed!!")
    
    def delData(self):
        row = getSelectedRowData(self.tableMedsDet)
        if row is not None:
                selected_id_no = row[0]
                self.med_add_updt_del_thread = AddUpdateDelMedDataThread(selected_id_no,flag=3)
                self.med_add_updt_del_thread.start()
                self.med_add_updt_del_thread.operationComplete.connect(self.refreshTable)
        else:
             self.showWarningMessage("Please select record!!")

    def refreshTable(self):
        self.tableMedsDet.clearContents()
        self.tableMedsDet.setRowCount(0)
        self.med_data_thread = MedDataRetrievalThread()
        self.med_data_thread.dataRetrieved.connect(self.updateMedTable)
        self.med_data_thread.start()

